import React from 'react';
import {Link} from 'react-router-dom';
import Logo from '../assets/img/logo.svg';

const Header = () => {
  return <header>
  <div className="container mx-auto"></div>
    <Link to='/'><img src={Logo} alt = 'logo'/></Link>
    </header>;
};

export default Header;
